import React from 'react';

export default function Footer() {
    return (
        <div id="footer" className="dark-background">
            <div>Recoilize is an open source project. Licensed under MIT License.</div>
            <a className="github-button" href="https://github.com/open-source-labs/Recoilize" data-icon="octicon-star" data-size="large" data-show-count="true" aria-label="Star Recoilize/github-buttons on GitHub">Star</a>        
        </div>
    )
}
